#include <TFT_eSPI.h>
#include <XPT2046_Touchscreen.h>
#include <HardwareSerial.h>

HardwareSerial SerialPort(2); // Use UART2
char receivedData[100]; // Buffer to hold incoming data
int pressureValues[10];  // Stores the last 10 pressure values
int currentIndex = 0;    // Current index in the buffer
int timeStep = 1;        // Time step between each point
int currentTime = 0;     // Current time counter
int pressureScale = 2;   // Default scale for the pressure values

TFT_eSPI tft = TFT_eSPI();

#define XPT2046_IRQ 36   // T_IRQ
#define XPT2046_MOSI 32  // T_DIN
#define XPT2046_MISO 39  // T_OUT
#define XPT2046_CLK 25   // T_CLK
#define XPT2046_CS 33    // T_CS

SPIClass touchscreenSPI = SPIClass(VSPI);
XPT2046_Touchscreen touchscreen(XPT2046_CS, XPT2046_IRQ);

// Clear, Zoom In, and Zoom Out button positions
int zoomInButtonX = 150;
int zoomInButtonY = 10;
int zoomInButtonWidth = 60;
int zoomInButtonHeight = 30;

int zoomOutButtonX = 210;
int zoomOutButtonY = 10;
int zoomOutButtonWidth = 60;
int zoomOutButtonHeight = 30;

int clearButtonX = 270;
int clearButtonY = 10;
int clearButtonWidth = 60;
int clearButtonHeight = 30;

void drawAxes() {
  // Clear the graph area
  tft.fillRect(40, 40, 260, 180, TFT_WHITE);  // Only clear graph space

  // Draw X-axis (time)
  tft.drawLine(40, 220, 300, 220, TFT_BLACK); // Horizontal axis (time)
  tft.setCursor(310, 210);
  tft.print("Time");

  // Draw Y-axis (pressure)
  tft.drawLine(40, 220, 40, 40, TFT_BLACK); // Vertical axis (pressure)
  tft.setCursor(10, 30);
  tft.print("Pressure");

  // Markings on the X-axis (time)
  for (int i = 0; i < 10; i++) {
    int timeMark = currentTime - (10 - 1 - i) * timeStep;
    tft.drawLine(40 + i * 26, 218, 40 + i * 26, 222, TFT_BLACK);
    tft.setCursor(35 + i * 26, 225);
    tft.print(timeMark); // Dynamic time values
  }

  // Markings on the Y-axis (pressure)
  for (int i = 0; i <= 6; i++) {
    tft.drawLine(38, 220 - i * 30, 42, 220 - i * 30, TFT_BLACK);
    tft.setCursor(5, 215 - i * 30);
    tft.print(i * 10 * pressureScale); // Pressure scale changes with zoom
  }
}

void drawButtons() {
  // Draw the "Zoom In" button
  tft.fillRect(zoomInButtonX, zoomInButtonY, zoomInButtonWidth, zoomInButtonHeight, TFT_LIGHTGREY);
  tft.setTextColor(TFT_BLACK, TFT_LIGHTGREY);
  tft.setCursor(zoomInButtonX + 10, zoomInButtonY + 10);
  tft.print("Zoom +");

  // Draw the "Zoom Out" button
  tft.fillRect(zoomOutButtonX, zoomOutButtonY, zoomOutButtonWidth, zoomOutButtonHeight, TFT_LIGHTGREY);
  tft.setTextColor(TFT_BLACK, TFT_LIGHTGREY);
  tft.setCursor(zoomOutButtonX + 10, zoomOutButtonY + 10);
  tft.print("Zoom -");

  // Draw the "Clear" button
  tft.fillRect(clearButtonX, clearButtonY, clearButtonWidth, clearButtonHeight, TFT_LIGHTGREY);
  tft.setTextColor(TFT_BLACK, TFT_LIGHTGREY);
  tft.setCursor(clearButtonX + 10, clearButtonY + 10);
  tft.print("Clear");
}

void plotGraph() {
  int prevX = 40;
  int prevY = 220 - pressureValues[0] * pressureScale; // Adjust scale based on zoom level

  for (int i = 1; i < 10; i++) {
    int x = 40 + i * 26; // X position for time
    int y = 220 - pressureValues[i] * pressureScale; // Adjust Y position based on zoom

    // Draw a line between the previous point and the current point
    tft.drawLine(prevX, prevY, x, y, TFT_RED);

    // Draw a small circle at each graph point
    tft.fillCircle(x, y, 3, TFT_BLUE);

    // Display the pressure value above the graph point
    tft.setCursor(x - 10, y - 15);
    tft.print(pressureValues[i]);

    // Update previous point
    prevX = x;
    prevY = y;
  }
}

void updateGraph(int newPressure) {
  // Shift old values to the left
  for (int i = 1; i < 10; i++) {
    pressureValues[i - 1] = pressureValues[i];
  }

  // Add the new pressure value to the end of the array
  pressureValues[9] = newPressure;

  // Clear the previous graph area and redraw axes
  tft.fillRect(41, 41, 259, 179, TFT_WHITE); // Clear the graph area, leaving the axes intact
  drawAxes();

  // Plot the updated graph
  plotGraph();
}

void clearGraph() {
  // Clear pressure values and reset current time
  for (int i = 0; i < 10; i++) {
    pressureValues[i] = 0;
  }
  currentTime = 0;  // Reset time

  // Clear the graph area and redraw axes
  tft.fillRect(41, 41, 259, 179, TFT_WHITE);
  drawAxes();
}

void zoomIn() {
  if (pressureScale < 5) {
    pressureScale++;
    updateGraph(pressureValues[9]); // Redraw with new scale
  }
}

void zoomOut() {
  if (pressureScale > 1) {
    pressureScale--;
    updateGraph(pressureValues[9]); // Redraw with new scale
  }
}

