void loop() {
  static unsigned long lastReceiveTime = 0;
  static int pressureValue = 0;
  static int valueIndex = 0;

  // Read incoming data from UART
  while (SerialPort.available()) {
    char c = SerialPort.read();
    if (c == '/') {
      // We have reached the end of a value
      if (valueIndex > 0) {
        receivedData[valueIndex] = '\0'; // Null-terminate the string
        pressureValue = atoi(receivedData); // Convert to integer
        updateGraph(pressureValue);
        valueIndex = 0; // Reset for the next value
        currentTime += timeStep; // Increment the current time
      }
    } else if (c == 't') {
      // Ignore the 't' character
      continue;
    } else {
      // Store the incoming character
      receivedData[valueIndex++] = c;
      if (valueIndex >= sizeof(receivedData) - 1) {
        valueIndex = sizeof(receivedData) - 1; // Prevent overflow
      }
    }
  }

  // Check if the touchscreen is touched
  if (touchscreen.tirqTouched() && touchscreen.touched()) {
    TS_Point p = touchscreen.getPoint();
    p.x = map(p.x, 200, 3700, 1, 320);
    p.y = map(p.y, 240, 3800, 1, 240);

    // Check if touch is inside the "Clear" button
    if (p.x > clearButtonX && p.x < clearButtonX + clearButtonWidth &&
        p.y > clearButtonY && p.y < clearButtonY + clearButtonHeight) {
      clearGraph();
    }

    // Check if touch is inside the "Zoom In" button
    if (p.x > zoomInButtonX && p.x < zoomInButtonX + zoomInButtonWidth &&
        p.y > zoomInButtonY && p.y < zoomInButtonY + zoomInButtonHeight) {
      zoomIn();
    }

    // Check if touch is inside the "Zoom Out" button
    if (p.x > zoomOutButtonX && p.x < zoomOutButtonX + zoomOutButtonWidth &&
        p.y > zoomOutButtonY && p.y < zoomOutButtonY + zoomOutButtonHeight) {
      zoomOut();
    }
  }
}
